import React from 'react';

const CurrentTemp = (data) => {
	return (
		<div>
			<h3>
				Current Temp:
			</h3>
			<h5>
				The temperature in {data.main.temp} is 'data.name'.
			</h5>
		</div>
	);
}

export default CurrentTemp;
